import { StyleSheet } from "react-native";

const ShootingStyle = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#FFFFFF",
    borderRadius: 30,
  },
  topinfo: {
    backgroundColor: "#48cff4",
    borderRadius: 30,
    width: 414,
    height: 525,
    alignItems: "center",
    justifyContent: "center",
  },
  row: {
    width: 414,
    height: 57,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    padding: 10,
    gap: 44,
  },
  backmenu: {
    width: 53,
    height: 53,
  },
  rectangle: {
    width: 53,
    height: 53,
    backgroundColor: "#71ddff",
    padding: 5,
    fontSize: 42,
    marginRight: 220,
    borderRadius: 100,
    cursor: "pointer",
    color: "rgba(255, 255, 255, 0.4)",
    alignItems: "center",
    justifyContent: "center",
  },
  icon: {
    display: "flex",
  },
  mainphoto: {
    width: 360,
    height: 360,
  },
  content: {
    width: 360,
    height: 360,
  },
  elipse2: {
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    boxSizing: "border-box",
    width: 360,
    height: 360,
    borderRadius: 100,
    border: "3px solid rgba(255, 255, 255, 0.2)",
  },
  elipse: {
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    width: 309,
    height: 309,
    borderRadius: 100,
    backgroundColor: "#FFFFFF",
  },
  camera: {
    width: 275,
    height: 275,
    borderRadius: 100,
  },
  captureButton: {
    backgroundColor: "#FFFFFF",
    padding: 10,
    borderRadius: 100,
    marginBottom: 10,
  },
  captureButtonText: {
    fontSize: 16,
    color: "#000000",
  },
  selectedImage: {
    width: 275,
    height: 275,
    borderRadius: 100,
  },
  defaultImage: {
    width: 275,
    height: 275,
    borderRadius: 100,
  },
  bottominfo: {
    backgroundColor: "#FFFFFF",
    width: 414,
    height: 371,
    borderRadius: 30,
    justifyContent: "center",
    alignItems: "center",
  },
  buttonmenu: {
    width: 414,
    height: 371,
    borderRadius: 30,
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "column",
  },
  upload: {
    width: 414,
    height: 100,
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    padding: 10,
    gap: 44,
  },
  imageLabel: {
    width: 100,
    height: 100,
    backgroundColor: "#71ddff",
    padding: 30,
    fontSize: 42,
    borderRadius: 100,
    cursor: "pointer",
    color: "rgba(255, 255, 255, 0.4)",
    alignItems: "center",
    justifyContent: "center",
  },
  test: {
    width: 414,
    height: 70,
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    marginTop: 20,
    gap: 44,
  },
  testText: {
    fontStyle: "normal",
    fontWeight: "600",
    fontSize: 17,
    lineHeight: 70,
    display: "flex",
    alignItems: "flex-end",
    color: "rgba(0, 0, 0, 0.4)",
    justifyContent: "center",
  },
});

export default ShootingStyle;
